    public function sign(&$request = array(), &$response = array(), &$app = array())
    {
        $app_key = 'test';
        $app_secret = '098f6bcd4621d373cade4e832627b4f6';

        $body = '{"method":"e3plus.oms.logistics.offline.send","timestamp":"20200623232700","shop_code":"EMC1","tid":"714462209340192864","shipping_code":"SF","shipping_sn":"288803971148","is_split":1,"sub_deal_code":"714462209341192864,714462209342192864","delivery_time":"2020-06-23 23:28:00"}';

        //原始数据
        $params1 = $params = [
            'app_key' => $app_key,
            'method' => 'e3plus.oms.logistics.offline.send',
            'timestamp' => '20200623232700',
            'shop_code' => 'EMC1',
            'encrypt' => 0,
        ];
        //字典正序排列
        ksort($params);

        //组织待加密字符串
        $sign_str = '';
        foreach ($params as $key => $value) {
            //key为空等不参与签名
            if ('' == $key || !isset($value)) {
                continue;
            }
            //上传的文件不参与签名
            if ("@" == substr($value, 0, 1)) {
                continue;
            }
            if (is_array($value) && count($value) >= 1) {
                //如果是数组,二维数组的key不参与签名,只有value参与签名
                foreach ($value as $_value) {
                    $sign_str .= $key . $_value;
                }
            } else {
                $sign_str .= $key . $value;
            }
        }
        //最后把body内容附加上
        $sign_str .= $body;

        $sign = md5($app_secret . $sign_str . $app_secret);

        $app['fmt'] = 'ori';

        $response = array('app_key' => $app_key, 'app_secret' => $app_secret, 'raw_params' => $params1, 'sort_params' => $params, 'body' => $body, 'sign_str' => $sign_str, 'sign' => $sign);
        $response['upper_sign'] = strtoupper($sign);
    }

    public function sign_with_encrypt(&$request = array(), &$response = array(), &$app = array())
    {
        $app_key = 'test';
        $app_secret = '098f6bcd4621d373cade4e832627b4f6';
        $encrypt_password = '098f6bcd';
        $encrypt_offset = '2627b4f6';

        $body = '{"method":"e3plus.oms.logistics.offline.send","timestamp":"20200623232700","shop_code":"EMC1","tid":"714462209340192864","shipping_code":"SF","shipping_sn":"288803971148","is_split":1,"sub_deal_code":"714462209341192864,714462209342192864","delivery_time":"2020-06-23 23:28:00"}';

        //原始数据
        $params1 = $params = [
            'app_key' => $app_key,
            'method' => 'e3plus.oms.logistics.offline.send',
            'timestamp' => '20200623232700',
            'shop_code' => 'EMC1',
            'encrypt' => 0,
        ];
        //字典正序排列
        ksort($params);

        //组织待加密字符串
        $sign_str = '';
        foreach ($params as $key => $value) {
            //key为空等不参与签名
            if ('' == $key || !isset($value)) {
                continue;
            }
            //上传的文件不参与签名
            if ("@" == substr($value, 0, 1)) {
                continue;
            }
            if (is_array($value) && count($value) >= 1) {
                //如果是数组,二维数组的key不参与签名,只有value参与签名
                foreach ($value as $_value) {
                    $sign_str .= $key . $_value;
                }
            } else {
                $sign_str .= $key . $value;
            }
        }
        //最后把body内容附加上
        $encrypt_body = $this->encrypt($body, $encrypt_password, $encrypt_offset, 'hex');
        $sign_str .= $encrypt_body;

        $sign = md5($app_secret . $sign_str . $app_secret);

